import styles from "../style";
import { arrowUp } from "../assets";

const GetStarted = () => {
  return (
    <div
      className={`${styles.flexCenter} w-[140px] h-[140px] rounded-full ${styles.gradient} p-[2px] cursor-pointer`}
    >
      <div
        className={`${styles.flexCenter} flex-col bg-primary w-[100%] h-[100%] rounded-full`}
      >
        <div className={`${styles.flexStart} flex-row`}>
          <p className="font-poppins font-medium text-[23px] leading-[23px]">
            <span className={`${styles.textgradient} text-white`}>Get</span>{" "}
          </p>
          <img
            src={arrowUp}
            alt="Arrow"
            className="w-[23] h-[23] object-contain"
          />
        </div>
        <p className="font-poppins font-medium text-[23px] leading-[23px]">
          <span className={`${styles.textgradient}`}>Started</span>
        </p>
      </div>
    </div>
  );
};

export default GetStarted;
